import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

const Add = function (props) {
  return <h1>Addition of {props.x} and {props.y} is {props.x + props.y}</h1>

}
const Greeting = function (props) {
  return <h1>Hello {props.name}, <Add /></h1>

}
ReactDOM.render(
  <>
    <Greeting name="simon" x={4} y={5}></Greeting>
    <Greeting name="react" x={6} y={7}></Greeting></>,
  document.getElementById('root')
);
